import React, {useState, useEffect} from "react";



const CheckProductPageTemplate = () => {

    const [input, setInput] = useState('');
    const [results, setResults] = useState('');

    const fetchData = (value: string) => {
        const response = fetch('http://localhost:8000/api/products/get', {
            method: 'GET',
            headers: {'Content-Type': 'application/json'},
        }).then((response) => response.json())
        .then((json) => {
            const results = json.filter((product:any) => {
                return (
                    value &&
                    product &&
                    product.name &&
                    product.name.toLowerCase().includes(value)
                );
            });
            setResults(results);
        })

    };

    const handleChange = (value:string) =>{
        setInput(value);
        fetchData(value);
    };

    return (
        <div>
            <div>Sprawdz produkt</div>
            <div className="input-div-wrapper">
                <input
                    placeholder="Type to search..."
                    value={input}
                    onChange={(e) => handleChange(e.target.value)}
                />
            </div>
            <ul>
        {results.map((product) => (
          <li key={product.id}>
            Name: {product.name}, Weight: {product.weight}, Energy: {product.energy}
            {/* Add more fields as needed */}
          </li>
        ))}
      </ul>
        </div>
    );
}

export default CheckProductPageTemplate;
